#nullable enable // autogenerated

using MVZ2.Vanilla;
using PVZEngine;

namespace MVZ2.GameContent.Armors
{
    public static class VanillaArmorTypes
    {
        public static readonly NamespaceID helmet = Get("helmet");
        public static readonly NamespaceID largeShield = Get("large_shield");
        public static readonly NamespaceID smallShield = Get("small_shield");
        public static readonly NamespaceID handheld = Get("handheld");
        private static NamespaceID Get(string name)
        {
            return new NamespaceID(VanillaMod.spaceName, name);
        }
    }
}
